    useFetchWeather();
    const currentWeather = useTypedSelector(state=>state.weather.currentState);
    const currentTheme = useTypedSelector(state=>state.currentPage.bgColor);
    return (
        <div className="App">
            <h1>Works</h1>
        </div>
    );
}

export default App;
